window.bookSummaryJSON = "<p>When Gunnar Long is transported into the first fully-immersive virtual MMORPG, he finds himself in a new world filled with magic, mystery, and adventure. </p> <p>No more 9-to-5 job. No more studio apartment. No more reality TV. </p> <p>Finally, he's in a place where he can call home, a place with people he can call friends. </p> <p>But as more people want to trade their real world lives to get inside Eden's Gate, the government of the outside world wants the \"game\" shut down at all costs. </p> <p>Gunnar must learn to survive, grow in power, and find a way to send a message back to his old home. </p> <p>\"We're fine. We're alive. Eden's Gate is real.\" </p> <p><b>Eden's Gate is a LitRPG adventure.</b> </p>"; 
